import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AddRestuarant from "./Components/AddRestuarant";

function App() {


  return (
    <Router>
          <Routes>
            <Route path="/" element={<AddRestuarant />} />
            <Route path="/allData" element={<AddRestuarant />} />
          </Routes>
    </Router>
  );
}

export default App;
